DROP TABLE IF EXISTS `tbl_activity`;
CREATE TABLE `tbl_activity`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `activity` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '活动名称',
  `price` int(11) NOT NULL COMMENT '报名费用',
  `detail` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '活动介绍',
  `start` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '开始时间',
  `ctime` datetime NOT NULL COMMENT '发布时间',
  `uid` int(11) NOT NULL COMMENT '发布者',
  `nid` int(11) NOT NULL DEFAULT 0 COMMENT '热门',
  `logo` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '宣传照',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `uid`(`uid`) USING BTREE,
  INDEX `nid`(`nid`) USING BTREE,
  CONSTRAINT `tbl_activity_ibfk_1` FOREIGN KEY (`uid`) REFERENCES `tbl_user` (`id`) ON DELETE CASCADE ON UPDATE RESTRICT,
  CONSTRAINT `tbl_activity_ibfk_2` FOREIGN KEY (`nid`) REFERENCES `tbl_nav` (`id`) ON DELETE CASCADE ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 10 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

