-- View structure for view_activity
-- ----------------------------
DROP VIEW IF EXISTS `view_activity`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_activity` AS select `tbl_activity`.`id` AS `id`,`tbl_activity`.`activity` AS `activity`,`tbl_activity`.`price` AS `price`,`tbl_activity`.`detail` AS `detail`,`tbl_activity`.`start` AS `start`,`tbl_activity`.`ctime` AS `ctime`,`tbl_activity`.`uid` AS `uid`,`tbl_activity`.`nid` AS `nid`,`tbl_activity`.`logo` AS `logo`,`tbl_user`.`username` AS `username` from (`tbl_activity` left join `tbl_user` on((`tbl_activity`.`uid` = `tbl_user`.`id`)));

-- ----------------------------
-- View structure for v_activity
