DROP VIEW IF EXISTS `v_activity`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_activity` AS select `view_activity`.`id` AS `id`,`view_activity`.`activity` AS `activity`,`view_activity`.`price` AS `price`,`view_activity`.`detail` AS `detail`,`view_activity`.`start` AS `start`,`view_activity`.`ctime` AS `ctime`,`view_activity`.`uid` AS `uid`,`view_activity`.`nid` AS `nid`,`view_activity`.`logo` AS `logo`,`view_activity`.`username` AS `username`,`tbl_nav`.`hot` AS `hot` from (`view_activity` left join `tbl_nav` on((`view_activity`.`nid` = `tbl_nav`.`id`)));

